async payload => {

  // DATUM OPGEGEVEN DOOR KLANT
  let datum = ''
  if(Array.isArray(payload.params.datum)) {
    datum = moment(new Date(payload.params.datum[0].value)).tz('Europe/Amsterdam')
  }

  // DIT IS DE DATUM VAN VANDAAG
  const vandaag = moment(new Date()).tz('Europe/Amsterdam')

  // CHECKEN OF DE OPGEGEVEN DATUM DOOR DE KLANT VOOR DE DATUM VAN VANDAAG IS
  const voor_vandaag = moment(datum).isBefore(vandaag)

  // ALS DE DATUM VAN DE KLANT --- VOOR --- DE DATUM VAN VANDAAG IS
  if(voor_vandaag === false){
      trigger('Bestelling-is-nog-onderweg')
  }

  // ALS DE DATUM VAN DE KLANT --- NA --- DE DATUM VAN VANDAAG IS
  if(voor_vandaag === true){
    trigger('Bestelling-had-binnen-moeten-zijn')
  }
}

